// frontend/src/pages/InscriptionActivite.js
import React, { useState, useContext } from 'react';
import { AuthContext } from '../contexts/AuthContext';
import axios from 'axios';

function InscriptionActivite() {
  const { user } = useContext(AuthContext);
  const [nom, setNom] = useState('');
  const [prenom, setPrenom] = useState('');
  const [age, setAge] = useState('');
  const [membre, setmembre] = useState('');
  const [activite, setActivite] = useState(''); // Ici, la valeur doit correspondre à l'ID de l'activité

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Affichage console pour vérification
    console.log('Nom:', nom);
    console.log('Prénom:', prenom);
    console.log('Âge:', age);
    console.log('Relation membre:', membre);
    console.log('Activité (ID):', activite);

    // Appel à l'endpoint pour inscrire l'utilisateur à l'activité
    try {
      const response = await axios.post(
        "http://localhost:5005/api/activities/inscrire",
        {
          activity_id: activite,
          user_id: user.userId, // Récupéré depuis le contexte Auth
        },
        { withCredentials: true }
      );
      alert(response.data.message);
    } catch (error) {
      console.error("Erreur lors de l'inscription à l'activité:", error);
      alert(error.response?.data?.error || "Erreur lors de l'inscription à l'activité");
    }
  };

  return (
    <div className="container my-5" style={{ maxWidth: '600px' }}>
      <h2>Inscription à une activité</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nom</label>
          <input
            type="text"
            className="form-control"
            value={nom}
            onChange={(e) => setNom(e.target.value)}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Prénom</label>
          <input
            type="text"
            className="form-control"
            value={prenom}
            onChange={(e) => setPrenom(e.target.value)}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Âge</label>
          <input
            type="number"
            className="form-control"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Relation membre</label>
          <select
            className="form-select"
            value={membre}
            onChange={(e) => setmembre(e.target.value)}
            required
          >
            <option value="">Sélectionnez la relation</option>
            <option value="Football">moi meme</option>
            <option value="Basketball">membre de famille</option>
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">Activité</label>
          <select
            className="form-select"
            value={activite}
            onChange={(e) => setActivite(e.target.value)}
            required
          >
            <option value="">-- Sélectionnez une activité --</option>
            {/* Remplacez les valeurs par les ID réels des activités */}
            <option value="1">Handball</option>
            <option value="2">Football</option>
            <option value="3">Basketball</option>
            <option value="4">Volleyball</option>
          </select>
        </div>
        <button type="submit" className="btn btn-dark">
          S'inscrire
        </button>
      </form>
    </div>
  );
}

export default InscriptionActivite;
